/**
 * @see org.apache.lucene.gdata.gom.GOMDateConstruct#setDate(java.util.Date)
 */
public void setDate(Date aDate) {
	if (aDate == null)
		return;
	this.date = aDate.getTime();
	this.rfc3339String = GOMUtils.buildRfc3339DateFormat(this.date);
}

